actionConfiguration.body:
() =>
	{
		storeValue("vayApplicationGSTN", vayGSTNInput.text);
		storeValue("vayApplicationIndConstitutionType", vayGSTNRespConstitution.text)
		if(appsmith.store.vayApplicantRole == 'Financier')
			{
				const response =  createCustomer.run(); 
	 			if(!!response){
		 				showAlert('Customer application record created')
	 			}else{
		  			showAlert('Customer application record creation failed...Contact Admin')
	 			}	
			 SendEmailToApplicant.run();
				 return navigateTo('India Financier')

			}
		else
			{
		if(vayGSTNRespConstitution.text == "LLP" || vayGSTNRespConstitution.text == "Public Limited Company" || 			vayGSTNRespConstitution.text == "LLC" )
		{
			 const response =  createCustomer.run(); 
	 			if(!!response){
		 				showAlert('Customer application record created')
	 			}else{
		  			showAlert('Customer application record creation failed...Contact Admin')
	 			}
			SendEmailToApplicant.run();
			 return navigateTo('India - Corporate',{});
		}
	else{
	 			const response =  createCustomer.run();
				if(!!response){
		 				showAlert('Customer application record created')
	 			}else{
		  			showAlert('Customer application record creation failed...Contact Admin')
	 			}	
		SendEmailToApplicant.run();
	 			return navigateTo('India - Non Corporate',{});
		}	
	}
	}

